CREATE SCHEMA HR_SOFTWARE_V2 ;
USE HR_SOFTWARE_V2 ; 


CREATE TABLE if not exists Employee(
employee_id int not null, 
team_id int, 
office_id int not null, 
first_name varchar(255) not null,
last_name varchar(255) not null, 
team_name varchar(255), 
office_name varchar(255) not null, 
birth_date date not null, 
nationality varchar(255) not null, 
status varchar(255) not null, 
gender varchar(255) not null, 
manager_name varchar(255),
email varchar(255) not null, 
PRIMARY KEY (employee_id)
);

CREATE TABLE if not exists Team(
team_id int not null, 
team_name varchar(255) not null,
team_leader_id int,
team_leader_name varchar(255), 
PRIMARY KEY (team_id),
FOREIGN KEY (team_leader_id) REFERENCES Employee (employee_id)
);


CREATE TABLE if not exists Office(
office_id int not null,
location_name varchar(255) not null, 
office_name varchar(255) not null, 
PRIMARY KEY (office_id)
);


CREATE TABLE if not exists Time_Tracking(
shift_id int auto_increment not null, 
employee_id int not null, 
clock_in varchar(255), 
clock_out varchar(255), 
shift_date date, 
shift_duration varchar(255), 
shift_estimated varchar(255) not null, 
shift_balance varchar(255) not null, 
PRIMARY KEY (shift_id),
FOREIGN KEY (employee_id) REFERENCES Employee (employee_id)
);

CREATE TABLE if not exists Time_off(
leave_id int auto_increment not null, 
employee_id int not null, 
leave_type_name varchar(255),
leave_status varchar(255), 
leave_duration varchar(255),
leave_start_on date,
leave_finish_on date, 
PRIMARY KEY (leave_id),
FOREIGN KEY (employee_id) REFERENCES Employee (employee_id)
);

CREATE TABLE if not exists Tasks(
Task_id int auto_increment not null, 
assignee_id int not null, 
task_completed_by int,
task_author int not null,
task_imported_for int not null, 
task_name varchar(255) not null, 
task_content varchar(255) not null,  
task_due_on date,
task_completed_at date, 
task_created_at date not null,
task_updated_at date,
PRIMARY KEY (Task_id),
FOREIGN KEY (assignee_id) REFERENCES Employee (employee_id),
FOREIGN KEY (task_author) REFERENCES Employee (employee_id),
FOREIGN KEY (task_completed_by) REFERENCES Employee (employee_id),
FOREIGN KEY (task_imported_for) REFERENCES Employee (employee_id)
);

CREATE TABLE if not exists Documents(
Document_id int auto_increment not null,
employee_id int not null, 
doc_created_by int not null, 
filename varchar(255) not null,
doc_type varchar(255) not null, 
doc_created_at date not null, 
PRIMARY KEY (Document_id),
FOREIGN KEY (employee_id) REFERENCES Employee (employee_id),
FOREIGN KEY (doc_created_by) REFERENCES Employee (employee_id)
);

CREATE TABLE if not exists Contracts(
contract_id int auto_increment not null, 
employee_id int not null, 
job_title varchar(255) not null, 
contract_date date not null, 
contract_starts_on date not null,
contract_ends_on date,
current_contract boolean not null,
salary_amount int not null,
salary_frequency varchar(255) not null,
working_hours varchar(255) not null,
contract_type varchar(255) not null,
professional_category varchar(255) not null,
terminate_reason varchar(255),
contract_observations varchar(255),
PRIMARY KEY (contract_id),
FOREIGN KEY (employee_id) REFERENCES Employee (employee_id)
);


